import { ITalent } from "@/state-management/talents/talent.interface";

const useTalentIconFactory = (talents: ITalent[]) => {
  const customIcons = [];

  const constructIcon = (talent: ITalent, code: string) => {
    const { path } = IconPaths.find(ip => ip.icon === talent.name)

    return {
      prefix: 'mw',
      iconName: talent.name.toLowerCase(),
      icon: [
        50,
        50,
        [],
        code,
        path
      ]
    }
  }

  talents.forEach((talent, i) => {
    customIcons.push(constructIcon(talent, `e00${i + 1}`));
  })

  return {
    customIcons
  }
}

